import React , { Component } from 'react';
import PROJECTS from './data/projects';

class Project extends Component {
    render() {
        const {title, image, description, link0, link1, link2} = this.props.project;
        return (
            <div style = {{display: 'inline-block', width: 400, margin: 50, verticalAlign: 'top'}}>
                <h3> {title} </h3>
                <img src = {image} alt='icons' style={{width:75, height: 75}} />
                <p>{description}</p>
                <a href={link0}>{link0}</a>
                <br></br>
                <a href={link1}>{link1}</a>
                <br></br>
                <a href={link2}>{link2}</a>
            </div>
        )
    }
}


class Projects extends Component {

    render() {
        return (
            <div>
                <h2> Projects </h2>
                <div>
                    {
                        PROJECTS.map((each)=>{
                            return (
                                <Project key={each.id} project={each} />
                            );
                        })
                    }
                </div>
            </div>
        )
    }
}

export default Projects;
